ommandMetadata\":{\"url\":\"\/timedtext_video?ref=watch\\u0026v=mifTvjiJrQc\",\"rootVe\":83769}},\"urlEndpoint\":{\"url\":\"\/timedtext_video?ref=watch\\u0026v=mifTvjiJrQc\"}}}]},\"noSubtitlesText\":{\"simpleText\":\"This video doesn't have subtitles or closed captions yet.\"},\"promoSubtitlesText\":{\"simpleText\":\"Help this video reach more people by contributing subtitles or closed captions in a language you speak.\"}}}}},\"videoDetails\":{\"videoId\":\"mifTvjiJrQc\",\"title\":\"Coronavirus Q \\u0026 A with Virologist Dr. Ken Rosenthal | Covid 19 Vaccine, Immunity, and Treatment\",\"lengthSeconds\":\"2349\",\"keywords\":[\"Coronavirus\",\"covid19\",\"novel coronavirus\",\"Ken Rosenthal\",\"pandemic\",\"virologist\",\"immunologist\",\"virology\",\"immunology\",\"vaccine\",\"herd immunity\",\"SAR CoV 2\",\"contamination\",\"physician\",\"primary care physician\",\"social distancing\",\"immunity\",\"modes of transmission for coronavirus\",\"counseling\",\"medical health\",\"mental health\"],\"channelId\":\"UCC_0vyFTKk1Nlodo4QsiQkw\",\"isOwnerViewing\":false,\"shortDescription\":\"In this video, I talk with Dr. Ken Rosenthal about the novel coronavirus (Covid 19). Dr. Rosenthal is a virologist and an immunology professor. Dr. Rosenthal answers several questions related to the novel coronarvirus:\\n1. Can you discuss the process of developing a vaccine? How long will it take? Does the process take a certain amount of time no matter how many people are working on the development? Is the development linear or trial and error?\\n2. Do ethical considerations slow the process down?\\n3. Would development accelerate if more financial resources were committed?\\n4. Once a vaccine has been developed, is it easy to produce substantial quantities of it?\\n5. Is developing a cure possible? Is the process similar to one used to find a vaccine?\\n6. What is the mechanism of death with Covid 19?\\n7. Why are some people asymptomatic while others die from the infection?\\n8. Will this virus become seasonal (like influenza)?\\n9. Without a vaccine, it is realistic to believe they can safely socialize with the population or do they need to stay isolated?\\n10. Can social distancing contain the virus or are we simply delaying the inevitable\\n11. What percentage of the population needs to be immune to realize “herd immunity?”\\n12. Do viruses ever serve a positive function or are the universally destructive? \\nDr. Rosenthal’s book: http:\/\/www.aimspress.com\/article\/10.3934\/Allergy.2018.3.148\\nMEDICAL MICROBIOLOGY, 9th EDITION, (2021). Ed., Murray, Rosenthal and Pfaller, Elsevier, London, (Author and Editor, Basic Microbiology, Immunology and Virology Sections.  ISBN 978-0-323-67322-8\\nExplanations of immunology:\\nRosenthal KS (2017) Dealing with Garbage is the Immune System’s Main Job. MOJ Immunol 5(6): 00174. DOI:\\n10.15406\/moji.2017.05.00174   http:\/\/medcraveonline.com\/MOJI\/MOJI-05-00174.pdf\\nRosenthal, KS. 2018. Immune Monitoring of the body’s borders. AIMS Allergy and Immunology, 2(3): 148–164. DOI: 10.3934\/Allergy.2018.3.148 \\nDr. Ken Rosenthal is a virologist and immunology professor at the Augusta University\/University of Georgia Medical Partnership. Dr. Rosenthal received his undergraduate degree from the University of Delaware, a Ph.D. in biochemistry from the University of Illinois at Urbana-Champaign, and completed post-doctoral education in tumor virology and immunology at Harvard Medical School and the Dana Farber Cancer Center.\\nSupport Dr. Grande on Patreon: https:\/\/www.patreon.com\/drgrande\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/mifTvjiJrQc\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLC15SmkchM8Zc8N7veabGVKDfbblQ\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/mifTvjiJrQc\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLA2f7umFhjhdniBCDKl02P0Ve_3jw\" utohide=1\"},\"title\":{\"simpleText\":\"Coronavirus Q \\u0026 A with Virologist Dr. Ken Rosenthal | Covid 19 Vaccine, Immunity, and Treatment\"},\"description\":{\"simpleText\":\"In this video, I talk with Dr. Ken Rosenthal about the novel coronavirus (Covid 19). Dr. Rosenthal is a virologist and an immunology professor. Dr. Rosenthal answers several questions related to the novel coronarvirus:\\n1. Can you discuss the process of developing a vaccine? How long will it take? Does the process take a certain amount of time no matter how many people are working on the development? Is the development linear or trial and error?\\n2. Do ethical considerations slow the process down?\\n3. Would development accelerate if more financial resources were committed?\\n4. Once a vaccine has been developed, is it easy to produce substantial quantities of it?\\n5. Is developing a cure possible? Is the process similar to one used to find a vaccine?\\n6. What is the mechanism of death with Covid 19?\\n7. Why are some people asymptomatic while others die from the infection?\\n8. Will this virus become seasonal (like influenza)?\\n9. Without a vaccine, it is realistic to believe they can safely socialize with the population or do they need to stay isolated?\\n10. Can social distancing contain the virus or are we simply delaying the inevitable\\n11. What percentage of the population needs to be immune to realize “herd immunity?”\\n12. Do viruses ever serve a positive function or are the universally destructive? \\nDr. Rosenthal’s book: http:\/\/www.aimspress.com\/article\/10.3934\/Allergy.2018.3.148\\nMEDICAL MICROBIOLOGY, 9th EDITION, (2021). Ed., Murray, Rosenthal and Pfaller, Elsevier, London, (Author and Editor, Basic Microbiology, Immunology and Virology Sections.  ISBN 978-0-323-67322-8\\nExplanations of immunology:\\nRosenthal KS (2017) Dealing with Garbage is the Immune System’s Main Job. MOJ Immunol 5(6): 00174. DOI:\\n10.15406\/moji.2017.05.00174   http:\/\/medcraveonline.com\/MOJI\/MOJI-05-00174.pdf\\nRosenthal, KS. 2018. Immune Monitoring of the body’s borders. AIMS Allergy and Immunology, 2(3): 148–164. DOI: 10.3934\/Allergy.2018.3.148 \\nDr. Ken Rosenthal is a virologist and immunology professor at the Augusta University\/University of Georgia Medical Partnership. Dr. Rosenthal received his undergraduate degree from the University of Delaware, a Ph.D. in biochemistry from the University of Illinois at Urbana-Champaign, and completed post-doctoral education in tumor virology and immunology at Harvard Medical School and the Dana Farber Cancer Center.\\nSupport Dr. Grande on Patreon: https:\/\/www.patreon.com\/drgrande\"},\"lengthSeconds\":\"2350\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/RioGrande51\",\"externalChannelId\":\"UCC_0vyFTKk1Nlodo4QsiQkw\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\",\"CZ\",\"DE\",\"DJ\",\"DK\",\"DM\",\"DO\",\"DZ\",\"EC\",\"EE\",\"EG\",\"EH\",\"ER\",\"ES\",\"ET\",\"FI\",\"FJ\",\"FK\",\"FM\",\"FO\",\"FR\",\"GA\",\"GB\",\"GD\",\"GE\",\"GF\",\"GG\",\"GH\",\"GI\",\"GL\",\"GM\",\"GN\",\"GP\",\"GQ\",\"GR\",\"GS\",\"GT\",\"GU\",\"GW\",\"GY\",\"HK\",\"HM\",\"HN\",\"HR\",\"HT\",\"HU\",\"ID\",\"IE\",\"IL\",\"IM\",\"IN\",\"IO\",\"IQ\",\"IR\",\"IS\",\"IT\",\"JE\",\"JM\",\"JO\",\"JP\",\"KE\",\"KG\",\"KH\",\"KI\",\"KM\",\"KN\",\"KP\",\"KR\",\"KW\",\"KY\",\"KZ\",\"LA\",\"LB\",\"LC\",\"LI\",\"LK\",\"LR\",\"LS\",\"LT\",\"LU\",\"LV\",\"LY\",\"MA\",\"MC\",\"MD\",\"ME\",\"MF\",\"MG\",\"MH\",\"MK\",\"ML\",\"MM\",\"MN\",\"MO\",\"MP\",\"MQ\",\"MR\",\"MS\",\"MT\",\"MU\",\"MV\",\"MW\",\"MX\",\"MY\",\"MZ\",\"NA\",\"NC\",\"NE\",\"NF\",\"NG\",\  linear or trial and error?\n2. Do ethical considerations slow the process down?\n3. Would development accelerate if more financial resources were committed?\n4. Once a vaccine has been developed, is it easy to produce substantial quantities of it?\n5. Is developing a cure possible? Is the process similar to one used to find a vaccine?\n6. What is the mechanism of death with Covid 19?\n7. Why are some people asymptomatic while others die from the infection?\n8. Will this virus become seasonal (like influenza)?\n9. Without a vaccine, it is realistic to believe they can safely socialize with the population or do they need to stay isolated?\n10. Can social distancing contain the virus or are we simply delaying the inevitable\n11. What percentage of the population needs to be immune to realize “herd immunity?”\n12. Do viruses ever serve a positive function or are the universally destructive? \nDr. Rosenthal’s book: "},{"text":"http://www.aimspress.com/article/10.3...","navigationEndpoint":{"clickTrackingParams":"CJYBEM2rARgCIhMIvJHZurCk6QIVDNZVCh3p5w53SIfapsTj9_STmgE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=http%3A%2F%2Fwww.aimspress.com%2Farticle%2F10.3934%2FAllergy.2018.3.148\u0026event=video_description\u0026redir_token=VKIo5Tb9ua_iUILWrOs62Y9ejfB8MTU4OTAzMTE1MEAxNTg4OTQ0NzUw\u0026v=mifTvjiJrQc","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=http%3A%2F%2Fwww.aimspress.com%2Farticle%2F10.3934%2FAllergy.2018.3.148\u0026event=video_description\u0026redir_token=VKIo5Tb9ua_iUILWrOs62Y9ejfB8MTU4OTAzMTE1MEAxNTg4OTQ0NzUw\u0026v=mifTvjiJrQc","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\nMEDICAL MICROBIOLOGY, 9th EDITION, (2021). Ed., Murray, Rosenthal and Pfaller, Elsevier, London, (Author and Editor, Basic Microbiology, Immunology and Virology Sections.  ISBN 978-0-323-67322-8\nExplanations of immunology:\nRosenthal KS (2017) Dealing with Garbage is the Immune System’s Main Job. MOJ Immunol 5(6): 00174. DOI:\n10.15406/moji.2017.05.00174 t have subtitles or closed captions yet."},"promoSubtitlesText":{"simpleText":"Help this video reach more people by contributing subtitles or closed captions in a language you speak."}}}}},"videoDetails":{"videoId":"mifTvjiJrQc","title":"Coronavirus Q \u0026 A with Virologist Dr. Ken Rosenthal | Covid 19 Vaccine, Immunity, and Treatment","lengthSeconds":"2349","keywords":["Coronavirus","covid19","novel coronavirus","Ken Rosenthal","pandemic","virologist","immunologist","virology","immunology","vaccine","herd immunity","SAR CoV 2","contamination","physician","primary care physician","social distancing","immunity","modes of transmission for coronavirus","counseling","medical health","mental health"],"channelId":"UCC_0vyFTKk1Nlodo4QsiQkw","isOwnerViewing":false,"shortDescription":"In this video, I talk with Dr. Ken Rosenthal about the novel coronavirus (Covid 19). Dr. Rosenthal is a virologist and an immunology professor. Dr. Rosenthal answers several questions related to the novel coronarvirus:\n1. Can you discuss the process of developing a vaccine? How long will it take? Does the process take a certain amount of time no matter how many people are working on the development? Is the development linear or trial and error?\n2. Do ethical considerations slow the process down?\n3. Would development accelerate if more financial resources were committed?\n4. Once a vaccine has been developed, is it easy to produce substantial quantities of it?\n5. Is developing a cure possible? Is the process similar to one used to find a vaccine?\n6. What is the mechanism of death with Covid 19?\n7. Why are some people asymptomatic while others die from the infection?\n8. Will this virus become seasonal (like influenza)?\n9. Without a vaccine, it is realistic to believe they can safely socialize with the population or do they need to stay isolated?\n10. Can social distancing contain the virus or are we simply delaying the inevitable\n11. What percentage of the population needs to be immune to realize “herd immunity?”\n12. Do viruses ever serve a positive function or are the universally destructive? \nDr. Rosenthal’s book: http://www.aimspress.com/article/10.3934/Allergy.2018.3.148\nMEDICAL MICROBIOLOGY, 9th EDITION, (2021). Ed., Murray, Rosenthal and Pfaller, Elsevier, London, (Author and Editor, Basic Microbiology, Immunology and Virology Sections.  ISBN 978-0-323-67322-8\nExplanations of immunology:\nRosenthal KS (2017) Dealing with Garbage is the Immune System’s Main Job. MOJ Immunol 5(6): 00174. DOI:\n10.15406/moji.2017.05.00174   http://medcraveonline.com/MOJI/MOJI-05-00174.pdf\nRosenthal, KS. 2018. Immune Monitoring of the body’s borders. AIMS Allergy and Immunology, 2(3): 148–164. DOI: 10.3934/Allergy.2018.3.148 \nDr. Ken Rosenthal is a virologist and immunology professor at the Augusta University/University of Georgia Medical Partnership. Dr. Rosenthal received his undergraduate degree from the University of Delaware, a Ph.D. in biochemistry from the University of Illinois at Urbana-Champaign, and completed post-doctoral education in tumor virology and immunology at Harvard Medical School and the Dana Farber Cancer Center.\nSupport Dr. Grande on Patreon: https://www.patreon.com/drgrande","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/mifTvjiJrQc/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLC15SmkchM8Zc8N7veabGVKDfbblQ","width":168,"height":94},{"url":"https://i.ytimg.com/vi/mifTvjiJrQc/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLA2f7umFhjhdniBCDKl02P0Ve_3jw","width":196,"height":110},{"url":"https://i.ytimg.com/vi/mifTvjiJrQc/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLDSLH_zjUwGGyrhCtCSsSMdu6GIbQ","width":246,"height":138},{"url":"https://i.ytimg.com/vi/mifTvjiJrQc/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLB2JA8s2NSbFXwViVSRYvB6MHdzmQ  the process similar to one used to find a vaccine?\n6. What is the mechanism of death with Covid 19?\n7. Why are some people asymptomatic while others die from the infection?\n8. Will this virus become seasonal (like influenza)?\n9. Without a vaccine, it is realistic to believe they can safely socialize with the population or do they need to stay isolated?\n10. Can social distancing contain the virus or are we simply delaying the inevitable\n11. What percentage of the population needs to be immune to realize “herd immunity?”\n12. Do viruses ever serve a positive function or are the universally destructive? \nDr. Rosenthal’s book: http://www.aimspress.com/article/10.3934/Allergy.2018.3.148\nMEDICAL MICROBIOLOGY, 9th EDITION, (2021). Ed., Murray, Rosenthal and Pfaller, Elsevier, London, (Author and Editor, Basic Microbiology, Immunology and Virology Sections.  ISBN 978-0-323-67322-8\nExplanations of immunology:\nRosenthal KS (2017) Dealing with Garbage is the Immune System’s Main Job. MOJ Immunol 5(6): 00174. DOI:\n10.15406/moji.2017.05.00174   http://medcraveonline.com/MOJI/MOJI-05-00174.pdf\nRosenthal, KS. 2018. Immune Monitoring of the body’s borders. AIMS Allergy and Immunology, 2(3): 148–164. DOI: 10.3934/Allergy.2018.3.148 \nDr. Ken Rosenthal is a virologist and immunology professor at the Augusta University/University of Georgia Medical Partnership. Dr. Rosenthal received his undergraduate degree from the University of Delaware, a Ph.D. in biochemistry from the University of Illinois at Urbana-Champaign, and completed post-doctoral education in tumor virology and immunology at Harvard Medical School and the Dana Farber Cancer Center.\nSupport Dr. Grande on Patreon: https://www.patreon.com/drgrande"},"lengthSeconds":"2350","ownerProfileUrl":"http://www.youtube.com/user/RioGrande51","externalChannelId":"UCC_0vyFTKk1Nlodo4QsiQkw","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD
